- "  Published on Oct 29, 2015The IU2U program, a collaborative effort at IU Bloomington
  that introduces incoming international students to life at IU, expanded this summer
  to include visits to India, South Korea and an additional location in China. The
  program launched in 2014 with sessions in Beijing, China, and included a stop in
  Shanghai this year.IU2U fosters student success by offering international students
  the opportunity to prepare for the academics, culture and engagement opportunities
  they will find at IU Bloomington. Over 200 parents and 250 students participated
  in this yearâ\x80\x99s sessions, representing more than 30 percent of all undergraduate
  international students who started at IU this fall.â\x80\x9CIU2U builds a global
  connection for the newest international students, current undergraduate students,
  faculty and staff that strengthens intercultural understanding and relationships,â\x80\x9D
  said Dennis Groth, vice provost for undergraduate education at IU Bloomington. â\x80\x9CThrough
  this program, we are engaging international students with the campus before they
  arrive, establishing a strong foundation for their success at IU.â\x80\x9D  \n"
